import styled from 'styled-components';


export const Area = styled.div`
  display: flex;
  background: black;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
`;

export const Card = styled.div`
  height: 300px;
  background: white;
  width: 200px;
  border-radius: 5px;
  display: inline-block;
  border: 1px solid #e8e8e8;
  &:hover {
    border: none;
    height: 310px;
    width: 210px;
    box-shadow: 0 0 20px 3px#e8e8e8;
  }
  `;
